import { Typography } from "@mui/material";
import React from "react";
import { ListItemText } from "@mui/material";

function Title() {
  return (
    <div className="Title">
      <ListItemText
        primary="第10回日本言語聴覚士協会 九州地区学術集会 福岡大会"
        primaryTypographyProps={{
          color: "#222222",
          variant: "h6",
          fontWeight: "bold",
        }}
        secondary="2022年1月29日〜30日"
        secondaryTypographyProps={{ color: "error", variant: "h4" }}
      />
      <ListItemText
        primary="一人ひとりのコミュニケーションを支える "
        primaryTypographyProps={{ color: "#222222" }}
        secondary="〜言語聴覚士としての責務〜"
        secondaryTypographyProps={{ color: "#222222" }}
      />
    </div>
  );
}

export default Title;
